import React from "react";
import { Component } from 'react';

class Temp extends Component {

    render() {
        return (
            <div>
                <h3>관리 임시 페이지입니다.</h3>
                <div>{this.props.names[this.props.id]}</div>
                <div>{this.props.descriptions[this.props.id]}</div>
                <div>{this.props.price}</div>
            </div>
        );
    }
}

export default Temp;

